import { useState } from "react";
import axios from "axios";
import "./contract.css";

function ContractPage() {
  const [jobId, setJobId] = useState("");
  const [salary, setSalary] = useState("");
  const [probationPeriod, setProbationPeriod] = useState("");
  const [contractStartDate, setContractStartDate] = useState("");
  const [contractEndDate, setContractEndDate] = useState("");
  const [benefits, setBenefits] = useState("");
  const [sendStatus, setSendStatus] = useState({ type: null, message: "" });

  const handleSubmit = async (e) => {
    e.preventDefault();
    setSendStatus({ type: null, message: "" });

    if (!jobId || !salary || !probationPeriod || !contractStartDate || !contractEndDate) {
      setSendStatus({ type: "error", message: "All fields are required!" });
      return;
    }

    const hrId = localStorage.getItem("hr_id"); // Assume hr_id is stored after login

    if (!hrId) {
      setSendStatus({ type: "error", message: "HR ID not found. Please log in again." });
      return;
    }

    try {
      const response = await axios.post("http://localhost:5000/api/contracts", {
        job_id: jobId,
        hr_id: hrId,
        salary,
        probation_period: probationPeriod,
        contract_start_date: contractStartDate,
        contract_end_date: contractEndDate,
        benefits,
      });

      if (response.data?.success) {
        setSendStatus({ type: "success", message: "Contract created successfully!" });
      } else {
        setSendStatus({ type: "error", message: response.data?.message || "Failed to create contract." });
      }
    } catch (err) {
      console.error("Error creating contract:", err);
      setSendStatus({ type: "error", message: "Failed to create contract. Please try again." });
    }
  };

  return (
    <div className="contract-container">
      <h2>Create Contract</h2>

      {sendStatus.type && (
        <div className={`status-message ${sendStatus.type}`}>
          {sendStatus.message}
        </div>
      )}

      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Job ID:</label>
          <input
            type="number"
            value={jobId}
            onChange={(e) => setJobId(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label>Salary:</label>
          <input
            type="text"
            value={salary}
            onChange={(e) => setSalary(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label>Probation Period (months):</label>
          <input
            type="number"
            value={probationPeriod}
            onChange={(e) => setProbationPeriod(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label>Contract Start Date:</label>
          <input
            type="date"
            value={contractStartDate}
            onChange={(e) => setContractStartDate(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label>Contract End Date:</label>
          <input
            type="date"
            value={contractEndDate}
            onChange={(e) => setContractEndDate(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label>Benefits:</label>
          <textarea
            value={benefits}
            onChange={(e) => setBenefits(e.target.value)}
            placeholder="Describe the benefits..."
            rows="5"
          />
        </div>

        <div className="form-actions">
          <button type="submit" className="primary-button">Create Contract</button>
        </div>
      </form>
    </div>
  );
}

export default ContractPage;
